window.addEventListener("load",(()=>{jQuery(document).on("ajaxComplete",((t,e,n)=>{const o=n?.data;if("string"==typeof o&&o.includes("action=vc_load_shortcode"))try{const t=[...decodeURIComponent(n.data).matchAll(/shortcodes\[\d+\]\[tag\]=([^\&]+)/g)];if(!t.length)return;if(!t.some((t=>"wpspeedo-team"===t[1])))return;const e=document.querySelector("#vc_inline-frame");if(!e||!e.contentWindow||!e.contentDocument)return;setTimeout((()=>{const t=e.contentWindow.jQuery;"function"==typeof t&&t(e.contentDocument).trigger("wps_team:init")}),150)}catch(t){console.warn("wps_team:init trigger failed:",t)}}))}));
